import React, { useState } from "react";
import axios from "axios";
import LOGIN from "./constants/login-constants";

const Login = ({ setToken }) => {
  const [user, setUser] = useState("");
  const [password, setPassword] = useState("");

  const loginUser = (setToken, credentials) => {
    axios
      .post(`${LOGIN.BASE_URL}/Login`, credentials)
      .then((response) => {
        console.log(user + " " + password + " " + response);
        const token = response.data.token;
        if(token !== "token_failure") {
            sessionStorage.setItem("sessionToken", response.data.token);
            setToken(response.data.token);

            return response.data.token;

        }
      })
      .catch((error) => {
        console.log(error);
      });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    loginUser(setToken, { user, password });
  };

  const handleUserChange = (user) => {
    setUser(user);
  };

  const handlePasswordChange = (password) => {
    setPassword(password);
  };

  return (
    <div>
      <h1>Login</h1>
      <form onSubmit={handleSubmit}>
        <label>
          User Name:
          <input
            type="text"
            id="username"
            value={user}
            onChange={(e) => handleUserChange(e.target.value)}
          />
        </label>
        <br />
        <label>
          Password:
          <input
            type="password"
            id="password"
            value={password}
            onChange={(e) => handlePasswordChange(e.target.value)}
          />
        </label>
        <br />
        <input type="submit" value="Submit" />
      </form>
      <h3>- or -</h3>
      <h2>Create Account</h2>
    </div>
  );
};
export default Login;
